import WelcomeAdmin from "../pages/WelcomeAdmin";
import WelcomeUser from "../pages/WelcomeUser";
import RegisterPage from "../pages/RegisterPage";
import LandingPage from "../pages/LandingPage";
import ManageCategories from "../pages/ManageCategories";
import GetCategories from "../pages/GetCategoriesAdmin";
// import EditQuiz from "../pages/EditQuiz";
import ProfileSettings from "../pages/ProfileSettings";
import Security from "../pages/Security";
import Login from "../pages/Login";
import CreateQuizAlt from "../pages/CreateQuizAlt";
import Mylibrary from "../pages/Mylibrary";
import MylibraryAdmin from "../pages/MylibraryAdmin";
import StartQuiz from "../pages/StartQuiz";
import EditQuizNew from "../pages/EditQuizNew";

const routes = [
  {
    element: <WelcomeAdmin />,
    path: "/welcomeadmin",
  },
  {
    element: <WelcomeUser />,
    path: "/welcomeuser",
  },
  {
    element: <CreateQuizAlt />,
    path: "/createquiz",
  },
  {
    element: <Mylibrary />,
    path: "/mylibrary",
  },

  {
    element: <MylibraryAdmin />,
    path: "/mylibraryadmin",
  },

  {
    element: <RegisterPage />,
    path: "/signup",
  },
  {
    element: <Login />,
    path: "/login",
  },

  {
    element: <ManageCategories />,
    path: "/managecategories",
  },
  {
    element: <GetCategories />,
    path: "/quizappgetcategories",
  },
  // {
  //   element: <EditQuiz />,
  //   path: "/editquiz/:uuid",
  // },
  {
    element: <StartQuiz />,
    path: "/startquiz/:uuid",
  },
  {
    element: <ProfileSettings />,
    path: "/profilesettings",
  },

  {
    element: <Security />,
    path: "/security",
  },

  {
    element: <Security />,
    path: "/categories",
  },

  { element: <LandingPage />, path: "/" },
];

export default routes;
